async function seedRoles() {
  for (const shortName in ROLES) {
    const { fullName, department } = ROLES[shortName];

    // Проверяем, существует ли уже роль с таким shortName
    const roleExists = await prisma.role.findUnique({
      where: { shortName },
    });

    if (!roleExists) {
      console.log(`Создаем роль ${shortName}...`);
      await prisma.role.create({
        data: {
          shortName,
          fullName,
          department,
        },
      });
    } else {
      console.log(`Роль ${shortName} уже существует.`);
    }
  }
}

async function seed() {
  const allDealUsers = workspaces.flatMap((workspace) =>
    workspace.groups.flatMap((group) =>
      group.users.flatMap((user) =>
        user.clients.flatMap((client) =>
          client.deals.flatMap((deal) =>
            deal.dealers.flatMap((sales) => {
              return {
                ...sales,
                updatedUserId: false,
                updatedDealId: false,
              };
            }),
          ),
        ),
      ),
    ),
  );

  const allDops = workspaces.flatMap((workspace) =>
    workspace.groups.flatMap((group) =>
      group.users.flatMap((user) =>
        user.clients.flatMap((client) =>
          client.deals.flatMap((deal) =>
            deal.dops.flatMap((dop) => {
              return {
                ...dop,
                updatedUserId: false,
                updatedDealId: false,
              };
            }),
          ),
        ),
      ),
    ),
  );

  // return console.log(allDealUsers.find((e) => e.dealId === 30 && e.userId === 533));
  for (const ws of workspaces) {
    const workspace = await prisma.workSpace.create({
      // where: { title: ws.title },
      // update: {},
      data: {
        title: ws.title,
        department: ws.department,
      },
    });
    for (const group of ws.groups) {
      const createdGroup = await prisma.group.create({
        // where: { title: group.title },
        // update: {},
        data: {
          title: group.title,
          workSpaceId: workspace.id,
        },
      });
      for (const user of group.users) {
        const createdUser = await prisma.user.create({
          // where: { email: user.email },
          // update: {},
          data: {
            fullName: user.fullName,
            email: user.email,
            password: user.password,
            tg: user.tg,
            roleId: user.roleId,
            workSpaceId: createdGroup.workSpaceId,
            groupId: createdGroup.id,
            deletedAt: user.deletedAt,
          },
        });
        for (let i = 0; i < allDealUsers.length; i++) {
          if (
            allDealUsers[i].userId === user.id &&
            !allDealUsers[i].updatedUserId
          ) {
            allDealUsers[i].updatedUserId = true;
            allDealUsers[i].userId = createdUser.id;
          }
        }
        for (let i = 0; i < allDops.length; i++) {
          if (allDops[i].userId === user.id && !allDops[i].updatedUserId) {
            allDops[i].updatedUserId = true;
            allDops[i].userId = createdUser.id;
          }
        }
        for (const client of user.clients) {
          const createdClient = await prisma.client.create({
            data: {
              fullName: client.fullName,
              phone: client.phone,
              chatLink: client.chatLink,
              adLink: client.adLink,
              type: client.type,
              gender: client.gender,
              info: client.info,
              inn: client.inn,
              firstContact: client.firstContact,
              workSpaceId: workspace.id,
              groupId: createdGroup.id,
              userId: createdUser.id,
            },
          });
          // console.log(createdClient.chatLink);
          for (const deal of client.deals) {
            const createdDeal = await prisma.deal.create({
              data: {
                saleDate: deal.saleDate,
                title: deal.title,
                price: deal.price,
                status: deal.status,
                card_id: deal.card_id.toString(),
                clothingMethod: deal.clothingMethod,
                source: deal.source,
                adTag: deal.adTag,
                discont: deal.discont,
                sphere: deal.sphere,
                city: deal.city,
                region: deal.region,
                maketType: deal.maketType,
                maketPresentation: deal.maketPresentation,
                period: deal.saleDate.slice(0, 7),
                workSpaceId: workspace.id,
                groupId: createdGroup.id,
                userId: createdUser.id,
                clientId: createdClient.id,
                deletedAt: deal.deletedAt,
              },
            });
            for (const dop of deal.dops) {
              for (let i = 0; i < allDops.length; i++) {
                if (
                  allDops[i].dealId === deal.id &&
                  !allDops[i].updatedDealId
                ) {
                  allDops[i].updatedDealId = true;
                  allDops[i].dealId = createdDeal.id;
                }
              }
            }
            for (const payment of deal.payments) {
              await prisma.payment.create({
                data: {
                  title: payment.title,
                  price: payment.price,
                  date: payment.date,
                  method: payment.method,
                  period: payment.date.slice(0, 7),
                  userId: createdUser.id,
                  dealId: createdDeal.id,
                },
              });
            }
            for (const dealer of deal.dealers) {
              for (let i = 0; i < allDealUsers.length; i++) {
                if (
                  allDealUsers[i].dealId === dealer.dealId &&
                  !allDealUsers[i].updatedDealId
                ) {
                  allDealUsers[i].updatedDealId = true;
                  allDealUsers[i].dealId = createdDeal.id;
                }
              }
            }
          }
        }
      }
    }
    for (const dealSource of ws.dealSources) {
      await prisma.dealSource.upsert({
        where: { title: dealSource.title },
        create: {
          title: dealSource.title,
          workSpaceId: workspace.id,
        },
        update: {},
      });
    }
    // console.log(w);
  }

  for (const dop of allDops) {
    await prisma.dop.create({
      data: {
        saleDate: dop.saleDate,
        type: dop.type,
        price: dop.price,
        period: dop.saleDate.slice(0, 7),
        userId: dop.userId,
        dealId: dop.dealId,
      },
    });
  }

  for (const sale of allDealUsers) {
    const { updatedDealId, updatedUserId, id, ...data } = sale;
    await prisma.dealUser.create({
      data,
    });
  }
  for (const doptype of doptypes) {
    await prisma.dopsType.create({
      data: {
        title: doptype.title,
      },
    });
  }
  for (const tag of tags) {
    await prisma.adTag.create({
      data: {
        title: tag.title,
      },
    });
  }
  for (const method of clothingMethods) {
    await prisma.clothingMethod.create({
      data: {
        title: method.title,
      },
    });
  }
  for (const sphere of spheres) {
    await prisma.sphere.create({
      data: {
        title: sphere.title,
      },
    });
  }
  console.log('Seed data added successfully!');
}

async function main() {
  try {
    await seedRoles();
    await seed();
    console.log('Сиды для ролей успешно выполнены.');
  } catch (error) {
    console.error('Ошибка при создании ролей:', error);
  } finally {
    await prisma.$disconnect();
  }
}

main();
